import React from 'react';
import Splashart from './Splashart.jpg';
import Carousel from 'react-bootstrap/lib/Carousel';


function categorizePhotos(category, photos) {
  let newArray = [];
  photos.forEach(function(photo) {
    if (photo.includes(category)) {
      newArray.push(photo);
    }
  });
  return newArray;
}

function addCarouselPhotos(photos) {
  photos.map(function(photo) {
    return (
      <Carousel.Item>
        <img alt="900x500" src={photo.src} />
      </Carousel.Item>
      )
  });
}

class HomeCarousel extends React.Component {

  constructor(props) {
    super(props);

    this.categorizePhotos = this.categorizePhotos.bind(this);
    this.addCarouselPhotos = this.addCarouselPhotos.bind(this);
  }

  categorizePhotos(category, photos) {
    let newArray = [];
    photos.forEach(function(photo) {
      if (photo.category.includes(category)) {
        newArray.push(photo.src);
      }
    });
    console.log("this is new array on home", newArray);
    return newArray;
  }

  addCarouselPhotos(photos) {
    photos.map(function(photo) {
      return (
        <Carousel.Item>
          <img alt="900x500" src={photo} />
        </Carousel.Item>
        )
    });
  }

  render() {
  return (
    <Carousel>
      {this.addCarouselPhotos(this.categorizePhotos('wedding', this.props.homecategory))}
    </Carousel>
    )
  }
}

class Home extends React.Component {

  render() {

  return (

    <div>
      <div className="splashcontainer">
        <img className="splashart" alt="splash" src={Splashart} />
      </div>
    </div>
  );
 }
}

export default Home;
